import logo from './components/images/test.webp';
import './App.css';

import React, { Component } from "react";

import About from "./src/components/About";

import {
  Box,
  Container,
  Row,
  Column,
  Column1,
  FooterLink,
  Heading,
  Imgaging,
  StartButton,
  InputBox,
} from "./AppStyles";

import {
  BrowserRouter as Router,
  Route,
  Switch,
  Link,
  Redirect
} from "react-router-dom";



function App()  {
  return (
    <Box>
      <Container>
        <Row>
          <Column>
            <Heading>====</Heading>
            <Heading>Find yur next perfect trip</Heading>
            <InputBox type="text" />
            <InputBox type="text" />
            <StartButton>Search</StartButton>
          </Column>
          <Column1>
            <Imgaging src={logo}></Imgaging>
          </Column1>
        </Row>
       </Container>
    </Box>
  );
}

export default App;
